import {React, useState} from 'react'

function Header(){
    const text = useState("Lewis Battersby")

    return (
        <header className="bg-white p-2 shadow-md font-medium rounded-b-3xl text-center text-2xl text-gray-800">
            {text}
        </header>
    )
}

export default Header
